import actionTypes from '../actionTypes'

export function onClickAdd() {
  return {
    type: actionTypes.CLICK_ADD
  }
}

export function onClickSubstract() {
  return {
    type: actionTypes.CLICK_SUBSTRACT
  }
}

export function onClickAddAsync() {
  return {
    type: actionTypes.CLICK_ADD_ASYNC
  }
}

export function onClickSubstractAsync() {
  return {
    type: actionTypes.CLICK_SUBSTRACT_ASYNC
  }
}

export function onClickCountry() {
  return {
    type: actionTypes.CLICK_COUNTRY
  }
}

export function onClickCity(value) {
  return {
    type: actionTypes.CLICK_CITY_ASYNC,
    value
  }
}
